import styled from 'styled-components';

const List = styled.ul`
  width: 100%;
  height: 100%;
  background-color: rgba(0, 0, 0, 0.4);
  overflow: auto;
  text-align: center;
`;

const ListElement = styled.li`
  display: inline-block;
`;

export { List, ListElement };
